(39, '', 'Ozzie Bluetooth Speaker E300 Green', 1, '<div data-v-36917099=\"\" class=\"row row-product-content\" style=\"overflow-wrap: break-word; display: flex; flex-flow: row wrap; align-items: baseline; font-size: 0.875rem; line-height: 1.4; color: rgba(0, 0, 0, 0.45); font-family: SukhumvitSet, -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif;\"><div data-v-36917099=\"\" class=\"row brand-sku-container\" style=\"overflow-wrap: break-word; display: flex; margin-top: 0.625rem;\"><div data-v-36917099=\"\" class=\"brand\" style=\"overflow-wrap: break-word; flex-shrink: 0;\"><span data-v-36917099=\"\" class=\"brand-title\" style=\"overflow-wrap: break-word;\">แบรนด์:</span> <span data-v-36917099=\"\" class=\"brand-value\" style=\"overflow-wrap: break-word;\">OZZIE</span></div><div data-v-36917099=\"\" class=\"sku-number\" style=\"overflow-wrap: break-word; flex-shrink: 0;\"><span data-v-36917099=\"\" class=\"sku-number-title\" style=\"overflow-wrap: break-word;\">SKU:</span> <span data-v-36917099=\"\" class=\"sku-number-value\" style=\"overflow-wrap: break-word;\">2000040000020</span></div></div></div><div data-v-36917099=\"\" class=\"product-short-description html-content\" style=\"overflow-wrap: break-word; color: rgba(0, 0, 0, 0.7); font-size: 16px; line-height: 1.5; margin-top: 1rem; margin-bottom: 1.5rem; font-family: SukhumvitSet, -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif;\">Ozzie E300 ลำโพงสำหรับ ผู้ที่ชอบใช้งานนอกสถานที่ สำหรับลำโพง Ozzie E300 ถือเป็นลำโพงขนาดใหญ่ที่สุดของรุ่น ด้วยลักษณะรูปแบบตัวลำโพงอาจจะดูใกล้เคียงกับรุ่นก่อน (E200) แต่รุ่นนี้มาพร้อมกับความแตกต่าง ที่ขนาดใหญ่ขึ้น มีฐานลองตั้งที่ตัวลำโพง ให้พลังเสียงเบสที่แน่นขึ้น การใช้งานที่ยาวนานคุ้มค่ามากยิ่งขึ้น ซึ่งตัวลำโพงประกอบไปด้วยปุ่มกดต่าง ๆ ทั้งปุ่มเปิด-ปิด, ปุ่มปรับระดับเสียง, Bluetooth, ปุ่มเล่น/หยุดเพลง, ไฟแสดงสถานะแบตเตอรี่ ส่วนด้านหลังนั้นจะมีช่องเชื่อมต่อ ช่องชาร์จแบตเตอรี่ ที่ถูกปิดไว้ด้วยจุกยางเพื่อป้องกันน้ำ ในส่วนของการใช้งานนั้น ลำโพง Ozzie E300 นั้นจะใช้การเชื่อมต่อผ่านทาง Bluetooth 5.0 และรองรับการเสียบสาย AUX 3.5mm มาพร้อมกับแบตเตอรี่ที่สามารถใช้งานได้นานสูงสุด 15 ชั่วโมง ขึ้นอยู่กับการใช้งานและระดับเสียง มีไมโครโฟนในตัว สามารถใช้รับโทรศัพท์ได้ด้วย ใช้การชาร์จผ่านทางช่อง USB - C ซึ่งจะใช้เวลาชาร์จเพียง 3 ชั่วโมง เท่านั้น ตัวลำโพงนั้นจะออกแบบมาให้สามารถกันน้ำได้ในระดับ IPX7 ซึ่งสามารถลงน้ำลึกได้ 1 เมตร ไม่เกิน 30 นาที โดยเป็นน้ำจืดเท่านั้น ถือได้ว่าเป็นการพกพาออกไปข้างนอก</div>', 7, 4, 4490.00, '0', '7de00d34670f610b8112.jpg'),
(40, '', 'ลำโพงปาร์ตี้ JBL PartyBox 710 Black', 5, '<div data-v-36917099=\"\" class=\"row row-product-content\" style=\"overflow-wrap: break-word; display: flex; flex-flow: row wrap; align-items: baseline; font-size: 0.875rem; line-height: 1.4; color: rgba(0, 0, 0, 0.45); font-family: SukhumvitSet, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\"><div data-v-36917099=\"\" class=\"row brand-sku-container\" style=\"overflow-wrap: break-word; display: flex; margin-top: 0.625rem;\"><div data-v-36917099=\"\" class=\"brand\" style=\"overflow-wrap: break-word; flex-shrink: 0;\"><span data-v-36917099=\"\" class=\"brand-title\" style=\"overflow-wrap: break-word;\">แบรนด์:</span>&nbsp;<span data-v-36917099=\"\" class=\"brand-value\" style=\"overflow-wrap: break-word;\">JBL</span></div><div data-v-36917099=\"\" class=\"sku-number\" style=\"overflow-wrap: break-word; flex-shrink: 0;\"><span data-v-36917099=\"\" class=\"sku-number-title\" style=\"overflow-wrap: break-word;\">SKU:</span>&nbsp;<span data-v-36917099=\"\" class=\"sku-number-value\" style=\"overflow-wrap: break-word;\">6925281990168</span></div></div></div><div data-v-36917099=\"\" class=\"product-short-description html-content\" style=\"overflow-wrap: break-word; color: rgba(0, 0, 0, 0.7); font-size: 16px; line-height: 1.5; margin-top: 1rem; margin-bottom: 1.5rem; font-family: SukhumvitSet, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\"><p style=\"overflow-wrap: break-word;\">JBL Original Pro Sound ทรงพลัง 800W RMS สร้างการเชื่อมต่อทางดนตรีในทันทีด้วยพลังเสียง JBL Original Pro ประสิทธิภาพสูง 800 วัตต์ ทวีตเตอร์คู่ 2.75\" และวูฟเฟอร์ 8\" จับคู่กับพอร์ตสะท้อนเสียงเบสที่ปรับแต่งแล้ว ไฟ สี ปาร์ตี้! ให้เป็นคอนเสิร์ตร็อค ไนต์คลับ และห้องคาราโอเกะที่รวมเป็นหนึ่งเดียว ซิงค์เพลงของคุณกับไฟแฟลชไดนามิกที่ปรับแต่งได้ JBL PartyBox 710 ก็กันน้ำกระเซ็น IPX4 คุณจึงไม่ต้องกังวลว่าปาร์ตี้จะเปียกและโลดโผนเกินไป</p><ul style=\"overflow-wrap: break-word; padding: 0px 0px 0px 2.5rem; margin: 1em 0px 0px;\"><li style=\"overflow-wrap: break-word; margin-top: 0px;\">Bluetooth Speaker</li><li style=\"overflow-wrap: break-word; margin-bottom: 0px;\">Frequency Response : 35 Hz - 20 kHz (-6dB)</li></ul></div>', 7, 4, 32900.00, '0', 'd6f27131db14736e5af5.jpg');

