></tr></tbody></table></div></div></section><section data-v-118a46ea=\"\" class=\"product-detail-description\" style=\"overflow-wrap: break-word; padding-top: 4rem; padding-bottom: 4rem; grid-column: span 12 / auto; color: rgb(37, 37, 37); font-family: SukhumvitSet, -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif; font-size: 16px;\"><div data-v-118a46ea=\"\" class=\"container\" style=\"overflow-wrap: break-word; width: 1176px; max-width: 1176px; padding: 0px 0.75rem; margin-top: 0px; margin-bottom: 0px;\"><div data-v-118a46ea=\"\" class=\"product-detail-description-container\" style=\"overflow-wrap: break-word;\"><div class=\"html-content\" style=\"overflow-wrap: break-word; font-size: 1rem; line-height: 1.5;\"><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/190380/Asus-Notebook-ROG-Strix-SCAR-17-con1.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><p style=\"overflow-wrap: break-word; text-align: center;\">ชิงชัยได้ในระดับสูงสุดด้วยคอมพิวเตอร์สำหรับเกมด้วยระบบปฏิบัติการ Windows 10 เครื่องนี้ ROG Strix SCAR 15/17 พร้อมรับมือกับความท้าทายทุกรูปแบบด้วยโปรเซสเซอร์ AMD Ryzen ™  รุ่นล่าสุดอันทรงพลัง ที่มีการ Overclocked มาให้จากโรงงาน และโปรเซสเซอร์กราฟิก GeForce® RTX™ ก้าวไปอีกขั้นกับความเร็วระดับ eSports ด้วยแผงจอภาพอัตรารีเฟรช 300 เฮิร์ตซ์/0.003 วินาที – โจมตีคู่ต่อสู้ได้อย่างแม่นยำด้วยแป้นพิมพ์เชิงกลแบบออปติคัลที่ตอบสนองเร็ว และคุณจะครองบัลลังก์ในทุกเวทีด้วยความได้เปรียบในการแข่งขัน</p><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/190381/Asus-Notebook-ROG-Strix-SCAR-17-con2.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><p style=\"overflow-wrap: break-word; text-align: center;\"><span style=\"overflow-wrap: break-word; margin-top: 0px; margin-bottom: 0px; font-size: 14pt;\"><span style=\"overflow-wrap: break-word; font-weight: 700; margin-top: 0px; margin-bottom: 0px;\">ชัยชนะอยู่ที่คุณ</span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\">ชนะใสๆ สไตล์สปอร์ตในทุกการแข่งขัน eSports ครั้งต่อๆ ไปของคุณ เส้นสายลายพาดตัดขวางฝาบนแบบมีสไตล์สะท้อนความแรงที่ล้ำสมัยที่อยู่ภายใน – หมวกเกราะ Armor Cap ที่ปรับแต่งและถอดเปลี่ยนได้เพิ่มสีสันให้กับตัวเครื่องของวคุณ – ไฟส่องสว่าง Aura Sync RGB อันชาญฉลาดช่วยให้ความคิดสร้างสรรค์ของคุณเปล่งประกาย แสงส่องสว่างจากโลโก้ ROG แบบเมทัลลิกและแป้นพิมพ์เชิงกลแบบออปติคัลที่ปรับแต่งได้รายคีย์ – และยังมีไฟ LED เพิ่มเติมส่องสว่างรอบๆ ฐานตัวเครื่องของคุณ และใต้ฐานของจอภาพ</p><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/190382/Asus-Notebook-ROG-Strix-SCAR-17-con3.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><p style=\"overflow-wrap: break-word; text-align: center;\"><span style=\"overflow-wrap: break-word; margin-top: 0px; margin-bottom: 0px; font-size: 14pt;\"><span style=\"overflow-wrap: break-word; font-weight: 700; margin-top: 0px; margin-bottom: 0px;\">แข่งขันได้ในระดับสูงสุด</span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\">เร่งงานและเกมด้วยความเร็วสูงด้วยคอมพิวเตอร์ที่ออกแบบมาเพื่ออัตรารีเฟรชเลขสามหลัก – ประสิทธิภาพกราฟิกระดับแนวหน้าด้วยโปรเซสเซอร์ GeForce® RTX™  ช่วยให้สามารถเล่นเกมได้อย่างรวดเร็วและเรียบลื่นในขณะที่โปรเซสเซอร์หลัก AMD Ryzen 5900HX รุ่นล่าสุด ที่มีการ Overclocked มาให้จากโรงงานที่ทรงพลัง ยิ่งจับคู่กับหน่วยความจำ DDR4-3200 ความจุสูงสุด 64GB จะพาคุณทะยานผ่านภาระงานที่หนักหน่วงได้ – อุปกรณ์เก็บข้อมูล SSD แบบ NVMe M.2 จำนวน 2 ตัวให้เวลาในการโหลดเกมขนาดใหญ่ได้อย่างรวดเร็ว</p></div></div></div></section>', 34),
