\"></span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\"><span style=\"overflow-wrap: break-word; margin-top: 0px; margin-bottom: 0px; font-size: 14pt;\"><span style=\"overflow-wrap: break-word; font-weight: 700; margin-top: 0px; margin-bottom: 0px;\">ไร้คู่ต่อสู้</span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\">ขจัดทุกอุปสรรคที่ขวางทางสู่ชัยชนะด้วยเมาส์ PRO ที่เร็วที่สุดและเบาที่สุดของเรา อาวุธใหม่ที่ยอดเยี่ยมสำหรับนักกีฬาอีสปอร์ตระดับมืออาชีพชั้นนำของโลก ด้วยน้ำหนักไม่ถึง 63 กรัม และมอบการเลื่อนที่เกือบไร้แรงเสียดทาน PRO X SUPERLIGHT สานต่อปรัชญาการออกแบบของเราที่ว่า ZERØ OPPOSITION หรือไร้คู่แข่ง ความมุ่งมั่นของเราคือการขจัดทุกอุปสรรค เพื่อสร้างสรรค์การเชื่อมต่อที่บริสุทธิ์ที่สุดระหว่างผู้เล่นและเกม</p><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/178938/G-PRO-X-Superlight-Magenta-con2.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><ul style=\"overflow-wrap: break-word; padding: 0px 0px 0px 2.5rem; margin: 1em 0px;\"><li style=\"overflow-wrap: break-word; margin-top: 0px; text-align: left;\">LIGHTSPEED™ ระบบไร้สายเกรดมือโปร</li><li style=\"overflow-wrap: break-word; text-align: left;\">เซ็นเซอร์ HERO 25K ความแม่นยำขั้นสูง</li><li style=\"overflow-wrap: break-word; margin-bottom: 0px; text-align: left;\">ไม่ถึง 63 กรัม น้ำหนักเบาเป็นพิเศษ</li></ul><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/178939/G-PRO-X-Superlight-Magenta-con3.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><p style=\"overflow-wrap: break-word; text-align: center;\"><span style=\"overflow-wrap: break-word; margin-top: 0px; margin-bottom: 0px; font-size: 14pt;\"><span style=\"overflow-wrap: break-word; font-weight: 700; margin-top: 0px; margin-bottom: 0px;\">ไร้อุปสรรค</span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\">ผลลัพธ์ของความร่วมมือของเรากับเหล่านักกีฬาอีสปอร์ตมืออาชีพชั้นนำคือ PRO X SUPERLIGHT ซึ่งได้รับการออกแบบทางวิศวกรรมโดยมีเป้าหมายเดียว เพื่อสร้างเมาส์เกมมิ่งไร้สายรุ่น PRO ที่เบาที่สุดเท่าที่เป็นไปได้ ในขณะที่ยังรักษาคุณภาพ ความสมบูรณ์เชิงโครงสร้าง และมาตรฐานระดับโปรที่ Logitech G นำเสนอ ความว่องไวยิ่งกว่าที่เคยมีมา</p><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/178940/G-PRO-X-Superlight-Magenta-con4.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><p style=\"overflow-wrap: break-word; text-align: center;\"><span style=\"overflow-wrap: break-word; margin-top: 0px; margin-bottom: 0px; font-size: 14pt;\"><span style=\"overflow-wrap: break-word; font-weight: 700; margin-top: 0px; margin-bottom: 0px;\">ปุ่มลัด ZERØ</span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\">PRO X SUPERLIGHT คือเมาส์ PRO ที่เบาที่สุด ซึ่งใช้ความก้าวหน้าทางวิศวกรรมในการออกแบบให้เหลือน้ำหนักไม่ถึง 63 กรัม นับว่าเบากว่าเมาส์ไร้สาย PRO มาตรฐานถึงเกือบ 25% เป้าหมายนี้บรรลุได้ผ่านการออกแบบอย่างพิถีพิถัน เพื่อลดน้ำหนักลงมากเป็นพิเศษ โดยไม่ลดทอนประสิทธิภาพใด ๆ</p><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/178941/G-PRO-X-Superlight-Magenta-con5.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><p style=\"overflow-wrap: break-word; text-align: center;\"><span style=\"overflow-wrap: break-word; margin-top: 0px; margin-bottom: 0px; font-size: 14pt;\"><span style=\"overflow-wrap: break-word; font-weight: 700; margin-top: 0px; margin-bottom: 0px;\">ไร้ความลังเล</span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\">มุ่งไปที่ชัยชนะด้วย LIGHTSPEED นวัตกรรมระบบไร้สายเกรดมือโปรของเรา เพื่อประสิทธิภาพการตอบสนองที่ฉับไวและการเชื่อมต่อที่มั่นคง</p><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/178942/G-PRO-X-Superlight-Magenta-con6.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><p style=\"overflow-wrap: break-word; text-align: center;\"><span style=\"overflow-wrap: break-word; margin-top: 0px; margin-bottom: 0px; font-size: 14pt;\"><span style=\"overflow-wrap: break-word; font-weight: 700; margin-top: 0px; margin-bottom: 0px;\">ไร้การพลาด</span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\">เซ็นเซอร์พิเศษ HERO 25K จาก Logitech G มอบความแม่นยำ ความเร็ว และความสม่ำเสมอที่ไม่มีใครเทียบ PRO X SUPERLIGHT มอบความแม่นยำที่สุดและการควบคุมละเอียดพิเศษ เพื่อความมั่นใจเต็มเปี่ยม โดยเฉพาะในช่วงเวลาสำคัญเสี้ยววินาทีของการแข่งขัน</p><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/178943/G-PRO-X-Superlight-Magenta-con8.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p><p style=\"overflow-wrap: break-word; text-align: center;\"><span style=\"overflow-wrap: break-word; margin-top: 0px; margin-bottom: 0px; font-size: 14pt;\"><span style=\"overflow-wrap: break-word; font-weight: 700; margin-top: 0px; margin-bottom: 0px;\">ไร้ความต้านทาน</span></span></p><p style=\"overflow-wrap: break-word; text-align: center;\">แผ่นหุ้มท้องเมาส์ PTFE ไร้สารเติมแต่งขนาดใหญ่มอบการเลื่อนที่ราบรื่น เพื่อการเชื่อมต่อที่ลื่นไหนเข้ากับเกมอย่างแท้จริง</p><p style=\"overflow-wrap: break-word; text-align: center;\"><img src=\"https://media-cdn.bnn.in.th/178944/G-PRO-X-Superlight-Magenta-con9.jpg\" alt=\"\" style=\"overflow-wrap: break-word; border-style: none; max-width: 100%; margin-top: 0px; margin-bottom: 0px; height: auto !important;\"></p></div></div></div></section>', 14),
